import React from "react";

const Dashboard = () => {
  return (
    <div className="min-h-screen bg-gray-100">
      <nav className="bg-white shadow-md p-4 flex justify-between">
        <h1 className="text-xl font-semibold">Dashboard</h1>
        <button className="bg-red-500 text-white px-4 py-2 rounded-lg">Logout</button>
      </nav>
      <div className="container mx-auto p-6">
        <h2 className="text-2xl font-semibold mb-4">Welcome to your Dashboard</h2>
        <p className="text-gray-600">Here is your interview history and progress.</p>
        <div className="mt-6 grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
          <div className="bg-white p-4 rounded-lg shadow-md">
            <h3 className="font-semibold text-lg">Interview 1</h3>
            <p className="text-gray-600">Self-Introduction & Technical Questions</p>
          </div>
          <div className="bg-white p-4 rounded-lg shadow-md">
            <h3 className="font-semibold text-lg">Interview 2</h3>
            <p className="text-gray-600">Ethical Questions & Coding Session</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
